  container: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    flexDirection: 'column'
  },
  root: {
    flexGrow: 1
  }
})


class GameOverComponent extends Component {

  constructor(props) {
    super(props)

    this.state = {

    };

    this.onGoHome = this.onGoHome.bind(this)
  }

  onGoHome(){
    this.props.callback("START")
  }

  render() {

    return (
      <Grid
        container
        direction="column"
        justify="center"
